.acrylic {
    padding: 1em 1em;
    position: relative;
    overflow: hidden;
  }

  .acrylic::before {
    filter: blur(10px);
    content: "";
    position: absolute;
  }

  .acrylic::after {
    content: "";
    position: absolute;
    left: 0;
    top: 0;
    right: 0;
    bottom: 0;
    z-index: -1;
    opacity: 0.75;
    border: 1px solid rgb(245, 245, 255);
    background: rgb(255, 255, 255);
    // background-image: url(data:image/png;base64,);
  }

  .shadow {
    border-radius: 0px;
    // box-shadow: 0 5px 30px rgba(0, 0, 0, 0.05), 0 1px 8px rgba(0, 0, 0, 0.05);    
  }
